import React from 'react';
import Imagen1 from '../assets/imagen1.jpg';
import Imagen2 from '../assets/imagen2.jpg';
import Imagen3 from '../assets/imagen3.jpg';

const Photo = () => {
    return (
        <div className='max-w-[1240px]  sm:visible mx-auto sm:grid md:grid-cols-5 px-15 '>
            <div class="<card w-80  bg-gray-50 mx-auto rounded-md px-3">

                <figure><img className='object-cover md:h-[250px] h-[200px] w-full ' src={Imagen1} />
                </figure>
            </div>
            <div class="card w-80  bg-gray-50 mx-auto rounded-none px-3">

                <figure><img className='object-cover md:h-[250px] h-[200px] w-full ' src={Imagen2} />
                </figure>
            </div>
            <div class="card w-80  bg-gray-50 mx-auto rounded-none px-3">

                <figure><img className='object-cover md:h-[250px] h-[200px] w-full ' src={Imagen3} />
                </figure>
            </div>
            <div class="card w-80  bg-gray-50 mx-auto rounded-none px-3">

                <figure><img className='object-cover md:h-[250px] h-[200px] w-full ' src={Imagen3} />
                </figure>
            </div>
            <div class="card w-80 bg-gray-50 mx-auto rounded-none px-3">

                <figure><img className='object-cover md:h-[250px] h-[200px] w-full ' src={Imagen3} />
                </figure>
            </div>

        </div>
    );
}

export default Photo;
